Ad Text:
Canberra, Parliamentary Triangle. WFH Hybrid
12 + 12  + 12 month contract (NV1 security clearance required) 
System Integrations Expertise

Our client, a very large, Federal Government Organisation, responsible for foreign policy, relations & trade, are Seeking the experience of multiple Senior System Analyst(s).

About the role - Senior System Analyst

The Systems Analyst will work across complex technical environments, leveraging modern technology stacks to design solutions that integrate with existing systems and align with the Digital Transformation Agency (DTA) standards.

Duties - Senior System Analyst

Serve in a key technical role within our clients ICT environment, responsible for analysing, designing, and implementing reliable and secure ICT systems;
Identify legacy on-premise systems that require modernisation or migration to cloud platforms, ensuring systems meet government policy objectives, security standards and operational requirements;
Support the Digital Uplift Program based on identified Work Packages.

Skills / Experience - Senior System Analyst

Minimum 5 years of experience in systems analysis;
Strong understanding of Microsoft Technologies;
System integration expertise;
Process improvement and optimisation;
Advanced knowledge of Microsoft Cloud Services (desirable);
Experience in Data Analytics and Reporting (desirable);
Automation and Scripting Experience (desirable).


How to Apply

